import React ,{Component}from 'react';
import {StyleSheet, View,Text,Image} from 'react-native';
import TabNavigator from 'react-native-tab-navigator';
import { createBottomTabNavigator } from '@react-navigation/bottom-tabs';
import { NavigationContainer } from '@react-navigation/native';
import ProviderOrder from './Scene/providerOrder.js'
import ProviderMain from './Scene/providerMain.js'
import Account from './Scene/account.js'
import Plan from './Scene/plan.js'
import { MaterialCommunityIcons } from '@expo/vector-icons';

export default function App() {
  const Tab = createBottomTabNavigator();

  return (
    <NavigationContainer>
        <Tab.Navigator>
          <Tab.Screen name="主页" component={ProviderMain} />
          <Tab.Screen name="订单" component={ProviderOrder} />
          <Tab.Screen
            name="行程"
            component={Plan}
            options={{
              tabBarLabel: 'Updates',
              tabBarIcon: ({ color, size }) => (
                <MaterialCommunityIcons name="bell" color={color} size={size} />
              ),
              tabBarBadge: 3,
            }}
             />
          <Tab.Screen
            name="账号"
            component={Account}
            options={{
              tabBarLabel: '账号',
              tabBarIcon: ({ color, size }) => (
              <MaterialCommunityIcons name="account" color="white" size={size} />
            ),
          }}
             />
        </Tab.Navigator>
    </NavigationContainer>
  );
}
